window.bookSummaryJSON = "<p><b>She's his enemy. He's her target. But could they be each other's only hope?</b></p> <p>Brielle owes Granny Dorrel seven years of her life. Seven years of slavery, serving as the ward witch’s huntress in the depths of Whispering Wood. </p> <p>Dire is a werewolf, a former slave of Granny’s in his own right…and Brielle’s newest target.</p> <p>Can these two enemies find a way to work together and undo the curses binding them? Or will the witch's hold on their broken hearts lead them to destroy one another?</p> <p><b><i>This stand-alone enemies-to-lovers romance is perfect for fans of Elise Kova and Holly Black.</i></b></p>"; 
